==Geography== Phaphund is located at {{coord|26.6|N|79.47|E|}}.<ref>[http://www.fallingrain.com/world/IN/36/Phaphund.html Falling Rain Genomics, Inc - Phaphund]</ref> It has an average elevation of 133&nbsp;metres (436&nbsp;feet).
==Demographics== {{As of|2001}} India [[census]],<ref>{{cite web|url=http://www.censusindia.net/results/town.php?stad=A&state5=999|archiveurl=https://web.archive.org/web/20040616075334/http://www.censusindia.net/results/town.php?stad=A&state5=999|archivedate=2004-06-16|title= Census of India 2001: Data from the 2001 Census, including cities, villages and towns (Provisional)|accessdate=2008-11-01|publisher= Census Commission of India}}</ref> Phaphund had a population of 15,341. Males constitute 53% of the population and females 47%. Phaphund has an average literacy rate of 62%, higher than the national average of 59.5%: male literacy is 67%, and female literacy is 56%. In Phaphund, 18% of the population is under 6 years of age.
